var $j = jQuery.noConflict();

var azure = {
	_originBar: function() {
		//Login button
		$j('#originBar-login').qtip({
			content: {
				text: $j('#originBar-login-content')
			},
			events: {
				render: function(event, api) {
					$j('#originBar-login-content').attr('src', $j('#originBar-login-content').data('src'));
				}	
			},
			hide: 'unfocus',
			position: {
				at: 'top center',
				my: 'bottom right',
				viewport: $j(window),
				effect: false
			},
			show: {
				event: 'click'
			},
			style: {
				classes: 'originBar-tooltip originBar-tooltip-login originUI-bg',
				def: false
			}
		}).click(function() {return false;});
		
		//Settings button
		$j('#bar-advanced-toggle').click(function() {
			$j('#bar-settings-advanced ul').slideToggle(200);
			return false;
		});
		
		$j('#originBar-settings').qtip({
			content: {
				text: $j('#originBar-settings-content')
			},
			hide: 'unfocus',
			id: 'bar-settings',
			position: {
				at: 'top center',
				my: 'bottom right',
				viewport: $j(window),
				effect: false
			},
			show: {
				event: 'click'
			},
			style: {
				classes: 'originBar-tooltip originBar-tooltip-settings originUI-bg',
				def: false
			},
			styles: {
				def: false
			}
		}).click(function() {return false;});
	},
	_originLogin: function() {
		$j('#modlgn_username').focus();
		if($j('#login-error-message').length) {
			//Fade out message
			$j('#login-error-message').delay(2500).fadeOut();
		}
	},
	_originNotification: function(text, style) {
		var style 	= (style != undefined)? style: 'default';
		
		$j(document.body).qtip({
			content: {
				text: text
			},
			position: {
				adjust: {
					x: -15,
					y: 40
				},
				at: 'top right',
				my: 'top right',
				target: $j(window)
			},
			show: {
				event: false,
				ready: true,
				effect: function() {
					$j(this).stop(0,1).fadeIn(400);
				},
				delay: 0,
				persistent: false,
				solo: $j('body')
			},
			hide: {
				event: false,
				effect: function(api) {
					$j(this).stop(0,1).fadeOut(400).queue(function() {
						api.destroy();							
					});
				}
			},
			style: {
				classes: 'originNotification originNotification-style-'+style,
				def: false,
				tip: false
			},
			events: {
				render: function(event, api) {
					var api			= $j(this).data('qtip');
					var lifespan	= 3500;
					
					clearTimeout(api.timer);
					if(event.type !== 'mouseover') {
						api.timer	= setTimeout(api.hide, lifespan);
					}
				}
			}
		}).removeData('qtip');
	}
};

